import { Link } from 'react-router-dom';
import {Container, Button} from '../../globalStyles'
import { AboutSec, Header } from "./AboutSection.elements";

const AboutSection = ({
    lightBg,
}) => {
    return (
        <>
            <AboutSec>
                <Container>
                    <Header>Here is why we exist</Header>
                    <Link to="/">
                    <Button >
                        Geza
                    </Button>
                    </Link>
                </Container>
            </AboutSec>
        </>
    )
}

export default AboutSection;
